var jumpEnabled=true;$.fn.jumpy=function(){this.data("_jumpySelector",this.selector);this.keyup(function(event){var tabKeyCode=9;if(event.keyCode==tabKeyCode){var previousJumpy=$(this)._getPreviousJumpyField();var isEmpty=$(previousJumpy).val().length==0;var hasDefaultValue=$(previousJumpy).data("_defaultValue")==$(previousJumpy).val();if(isEmpty||hasDefaultValue)previousJumpy.focus().select();return false;}if(jumpEnabled&&($(this).val().length>=parseInt($(this).attr("maxlength")))){var nextjf=$(this)._getSubsequentJumpyField();$(nextjf).focus().select();jumpEnabled=false;setTimeout(function(){jumpEnabled=true;},50);}});};$.fn._getSubsequentJumpyField=function(){var lastIterated=null;var subsequent=null;var originator=this[0];var selector=$(this).data("_jumpySelector");$(selector).each(function(index,iterated){if(subsequent==null){if(lastIterated==originator){subsequent=this;}lastIterated=this;}});return subsequent;};$.fn._getPreviousJumpyField=function(){var lastIterated=null;var previous=null;var originator=this[0];var selector=$(this).data("_jumpySelector");$(selector).each(function(index,iterated){if(previous==null){if(this==originator){previous=lastIterated;}lastIterated=this;}});return previous;}

//Helpers compare
Handlebars.registerHelper('compare', function (lvalue, operator, rvalue, options) {
    var operators, result;
    if (arguments.length < 3) {
        throw new Error("Handlerbars Helper 'compare' needs 2 parameters");
    }
    if (options === undefined) {
        options = rvalue;
        rvalue = operator;
        operator = "===";
    }
    operators = {
        '==': function (l, r) { return l == r; },
        '===': function (l, r) { return l === r; },
        '!=': function (l, r) { return l != r; },
        '!==': function (l, r) { return l !== r; },
        '<': function (l, r) { return l < r; },
        '>': function (l, r) { return l > r; },
        '<=': function (l, r) { return l <= r; },
        '>=': function (l, r) { return l >= r; },
        'typeof': function (l, r) { return typeof l == r; }
    };
    if (!operators[operator]) {
        throw new Error("Handlerbars Helper 'compare' doesn't know the operator " + operator);
    }
    result = operators[operator](lvalue, rvalue);
    if (result) {
        return options.fn(this);
    } else {
        return options.inverse(this);
    }
});

var DateFormats = {
       short: "DD MMMM - YYYY",
       long: "dddd DD.MM.YYYY HH:mm",
       hour: "hh:mm A",
       year: "YYYY",
       month_short: "MMM",
       month_name: "MMMM",
       usa: "DD/MM/YYYY",
       usa_long: "DD/MM/YY hh:mm A",
       day: "DD",
       timestamp: "X"
};

// Deprecated since version 0.8.0
Handlebars.registerHelper("formatDate", function(datetime, format) {
    if (moment) {
        format = DateFormats[format] || format;
        return moment(datetime).format(format);
    } else {
        return datetime;
    }
});

Handlebars.registerHelper ('truncate', function (str, len) {
    if (str.length > len && str.length > 0) {
        var new_str = str + " ";
        new_str = str.substr (0, len);
        new_str = str.substr (0, new_str.lastIndexOf(" "));
        new_str = (new_str.length > 0) ? new_str : str.substr (0, len);

        return new Handlebars.SafeString ( new_str +'...' );
    }
    return str;
});

//Helpers compare
Handlebars.registerHelper('findElement', function (attr, value, options) {
    var search  = attr+'="'+value+'"';
    var result  = document.querySelector('['+search+']');
    if (result.length > 0) {
        return options.fn(this);
    } else {
        return options.inverse(this);
    }
});

